import React from 'react';
import './Projects.css';

function Projects() {
  return (
    <div className="projects-container">
      <h2>Projects</h2>
      <div className="project">
        <h3>Project 1: Data Visualization Dashboard</h3>
        <p>A comprehensive data dashboard providing business insights using Python, Pandas, and Matplotlib.</p>
      </div>
      <div className="project">
        <h3>Project 2: Inventory Management System</h3>
        <p>An automated inventory management system using React.js and Firebase.</p>
      </div>
    </div>
  );
}

export default Projects;
